ation on this website is correct, we do not warrant its completeness or accuracy; nor do we promise to ensure that the website remains available or that the material on the website is kept up to date.</p>\n<p><strong>Disclaimer and Instructions</strong></p>\n<p>To the maximum extent permitted by applicable law, we exclude all representations, warranties and conditions relating to our website and the use of this website. Nothing in this disclaimer will:</p>\n<p>limit or exclude our or your liability for death or personal injury;</p>\n<p>limit or exclude our or your liability for fraud or fraudulent misrepresentation;</p>\n<p>limit any of our or your liabilities in any way that is not permitted under applicable law; or</p>\n<p>exclude any of our or your liabilities that may not be excluded under applicable law.</p>\n<p>The limitations and prohibitions of liability set in this Section and elsewhere in this disclaimer: (a) are subject to the preceding paragraph; and (b) govern all liabilities arising under the disclaimer, including liabilities arising in contract, in tort and for breach of statutory duty.</p>\n<p>As long as the website and the information and services on the website are provided free of charge, we will not be liable for any loss or damage of any nature.</p>\n<p style="text-align: center;"><br /><span style="font-size: 14pt;"><strong>Seller-Vendors/Individuals</strong></span></p>\n<p><br /><strong>Cancellation &amp; Refund Policy</strong></p>\n<p>Cancellations will be considered only if the request is made immediately after placing the order. However, the cancellation request may not be entertained if the orders have been communicated to the vendors/merchants and they have initiated the process of shipping them.</p>\n<p><br />LAMZING TECHNOLOGIES PRIVATE LIMITED does not accept cancellation requests for perishable items like flowers, eatables etc. However, refund/replacement can be made if the customer establishes that the quality of product delivered is not good.</p>\n<p>In case of receipt of damaged or defective items please report the same to our Customer Service team. The request will, however, be entertained once the merchant has checked and determined the same at his own end.</p>\n<p>This should be reported within the same day of receipt of the products.</p>\n<p>In case you feel that the product received is not as shown on the site or as per your expectations, you must bring it to the notice of our customer service or contact the seller/merchant/vendor within the same day of receiving the product. The Customer Service Team after looking into your complaint will take an appropriate decision.</p>\n<p>In case of complaints regarding products that come with a warranty from manufacturers, please refer the issue to them.</p>\n<p>In case of any Refunds approved by the LAMZING TECHNOLOGIES PRIVATE LIMITED, it will take 3-5 days for the refund to be processed to the end customer.</p>\n<p><strong>Shipping &amp; Delivery Policy</strong></p>\n<p>For International buyers, orders are shipped and delivered through registered international courier companies and/or International speed post only. For domestic buyers, orders are shipped through registered domestic courier companies and /or speed post only. Orders are shipped within 0-2 days or as per the delivery date agreed at the time of order confirmation and delivering of the shipment subject to Courier Company / post office norms.</p>\n<p>LAMZING TECHNOLOGIES PRIVATE LIMITED is not liable for any delay in delivery by the courier company / postal authorities and only guarantees to hand over the consignment to the courier company or postal authorities within 0-2 days from the date of the order and payment or as per the delivery date agreed at the time of order confirmation. Delivery of all orders will be to the address provided by the buyer. Delivery of our services will be confirmed on your mail ID as specified during registration. For any issues in utilizing our services you may contact our helpdesk on contact@ningthi.com</p>\n<p><br /><strong>Delivery Booking time and delivery service time for local:</strong></p>\n<p>If you book the delivery order before 1 PM then Pickup and drop service time will be between 1 PM and 5 PM - <strong>Same day delivery</strong><br />If you book the delivery order after 1 PM then pickup and drop service time will be in next day morning (7AM - 12 Noon) - <strong>Next day delivery</strong><br />There may be Instant delivery service but not sure, it will depend on agents. Extra charge may be added to normal charge. - <strong>Instant Delivery</strong></p>\n<p>Note: For point 1 and 2 if our delivery services are not congested or some of our agents are free then Ningthi can give Same day delivery.</p>\n<p>&nbsp;</p>\n<p><strong>Instruction for Seller-Vendors/Individuals Ningthi Order Delivery Platform:-</strong></p>\n<p>Users&nbsp; need to Sign up the Ningthi Order Delivery Web platform to avail this Service.</p>\n<p><strong>During the process Users need to provide the following details:</strong></p>\n<p>Name of Shop/ Name of the User</p>\n<p>Proof of Age and Address (Adhar card or driving license)</p>\n<p>Location of Shop/Business</p>\n<p>Phone number</p>\n<p>Valid email address</p>\n<p><br />After the sign up process, users can login and create the order based on the type of Packages.</p>\n<p><br />Users need to read and accept the terms and conditions of Ningthi before signup and create the order.</p>\n<p><strong>Signup and login:</strong></p>\n<p>Users should give the self valid user information during the signup. If any misuse of other data shall be taken&nbsp; responsibility by the user in case of any legal action.</p>\n<p><strong>Order Creation/placing order:</strong></p>\n<p><br />User should select the valid package type, based on the package item the user wants to deliver.</p>\n<p>Users should give the valid information for order (pickup point address, drop point address, item details etc.)</p>\n<p>User will get the amount to be paid for order delivery before submitting the order. Users have to pay the given amount.</p>\n<p><br />Or</p>\n<p>Users can order through phone call or whatsapp text or email.</p>\n<p><strong>Delivery service charge info:</strong></p>\n<p><br />Our delivery charge will depend on your package type. We have different package type category</p>\n<p>See our pricing info base on package category click here.</p>\n<p>&nbsp;</p>\n<p style="text-align: center;"><strong><span style="font-size: 14pt;">Delivery Partners / Delivery agents</span></strong></p>\n<p><br />Our Ningthi staff will assign the multiple orders or single orders (for picking up and dropping packages) at one time to the Ningthi Delivery Executive. Using the Ningthi Delivery app and giving delivery service will help you to earn money in your free time or you can do it on a full time basis.&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Instruction to follow by DE:-</strong></p>\n<p><br />DAs needs to download and use our Android/iOS app to sign up and avail this service.</p>\n<p><br />During the sign up process DAs need to provide the following details:</p>\n<p style="padding-left: 40px;"><br /><em>1. Full Name, address and other information.</em><br /><em>2. Proof of Age and Address (Scan photo copy of Adhar card)</em><br /><em>3. Type of Vehicle to be used (photo of vehicle with vehicle no)</em><br /><em>4. Vehicle Registration Details (Scan copy of Vehicle registration card)</em><br /><em>5. Driver&rsquo;s License Details (Scan copy of Driving License)</em><br /><em>6. Phone Number</em></p>\n<p>After the signup process, the Ningthi team will verify the details. Upon verification the company will update the verification status to the DAs.</p>\n<p><br />DAs may be required to visit the office for verification.</p>\n<p><br />Only those verified DAs can obtain delivery jobs.</p>\n<p><br />DAs will use the Ningthi Delivery Android/iOS app to receive delivery tasks allocated by Ningthi Staffs.</p>\n<p><br />DAs need to set availability status on the app, if status is on, DA will get notified when a task is allocated by Ningthi Staff, or gets direct assignment from the SOs.</p>\n<p><br />DAs will get the task details on their screen, viz. Pickup location, drop location, distance in km, Delivery Mode, fair approximation etc.</p>\n<p>&nbsp;</p>\n<p><strong>DAs Time to track and every update status on Ningthi Delivery app:&nbsp;&nbsp;</strong></p>\n<p><br />DAs should update the following status on DE apps.&nbsp;</p>\n<p><br />Order assigned &rarr; Order accept/Cancel &rarr; Way to pick up location &rarr; Reach the exact location of pickup point (time counter started for waiting time) &rarr; Order package picking up from seller &rarr; Way to drop location &rarr; Delivered the parcel.&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>Accept the task or decline the task.</strong></p>\n<p><br /><strong>If accepted:</strong></p>\n<p><br />Before picking up the package, take a picture of the package (3 to 4 photos of different angles) and acknowledge the status of the package condition.</p>\n<p><br />If the package condition is okay, proceed to the drop location.</p>\n<p><br />Upon arrival at the drop location, scan the QR code or OTP from the customer, and also take a picture(2 to 3 photos) of the delivered product.</p>\n<p><br />Upon successful delivery DA will receive the payment (there will be payout circle by Weekly or monthly or days)</p>\n<p>&nbsp;</p>\n<p><strong>If declined:</strong></p>\n<p><br />There may be deduction of some amount (Rs 2 to Rs 10 - may change time to time) of each order during the payout.</p>\n<p><br />For emergency cancellations within the phase of &ldquo;after picking up the package and on the way to delivery&rdquo;:&nbsp;</p>\n<p><br />Should be reported earlier (using app or phone call to Ningthi support service) and then the package should be handed over to the Pickup source or in the Ningthi Office.</p>\n<p>&nbsp;</p>\n<p><strong>DELIVERY P